package eu.angel.bleembedded.lib.beacon.msg;

import org.altbeacon.beacon.Beacon;
import org.altbeacon.beacon.BeaconManager;
import org.altbeacon.beacon.BeaconParser;

/**
 * Created by giova on 25/01/2017.
 */

public class BeaconMsgGimbal extends BeaconMsgBase {

   // NOTE: I removed "s:0-1=FEFD," at the beginning because the AltBeacon message parsing is limited
    // to the pdu with type 0xFF, which begins with 8C00. In Gimbal, the service uuid is omitted in 0xFF pdu,
    // while in Eddystone the service uuid is replicated also in the 0xFF type pdu
    public static String MSG_LAYOUT = "m:0-1=8c00,i:2-10,p:11-11";  // "s:0-1=FEFD,"

    // FEFD service uuid has been detected with nrf connect scanner app, but can also be found at:
    // https://www.bluetooth.com/specifications/assigned-numbers/16-bit-uuids-for-members
    public static String MSG_SERVICEUUID = "FEFD";  //

    // 8C00 company identifier has been detected with nrf connect scanner app, but can also be found at:
    // https://www.bluetooth.com/specifications/assigned-numbers/company-identifiers
    public static String MSG_TYPECODE = "8C00";

    public BeaconMsgGimbal(Beacon b) {
        super(b);
    }

    @Override
    public BeaconMsgBase parse() {
        if (!this.MSG_TYPECODE.toUpperCase().equals(Long.toHexString(this.getBeaconTypeCode()).toUpperCase())) {
            return null;
        }
        // Note: Here you can put your code to parse message data fields into convenient instance class variables
        return this;
    }

    @Override
    public String getImage() {
        return BASE64_IMAGE;
    }


    private static String BASE64_IMAGE = "";
}
